        /// <summary>The table number.</summary>
        readonly int TableNumber;

        /// <summary>The max. x-index.</summary>
        readonly int XLength;

        /// <summary>The max. y-index.</summary>
        readonly int YLength;

        /// <summary>The number of linbits.</summary>
        readonly int LinBitCount;

        /// <summary>The max number to be stored in linbits.</summary>
        readonly int LinBitMax;

        /// <summary>The decoder tree.</summary>
        readonly int[][] Tree = null;

        /// <summary>The length of the decoder tree. </summary>
        readonly int TreeLength;

        /// <summary>
        /// Initializes a new instance of the <see cref="MP3AudioHuffman"/> class.
        /// </summary>
        /// <param name="tableNumber">The table number.</param>
        /// <param name="x">The max. x-index.</param>
        /// <param name="y">The max. y-index.</param>
        /// <param name="linBitCount">The linear bit count.</param>
        /// <param name="linBitMax">The maximum linear bit count.</param>
        /// <param name="tree">The decoder tree.</param>
        /// <param name="treeLength">Length of the decoder tree.</param>
        MP3AudioHuffman(int tableNumber, int x, int y, int linBitCount, int linBitMax, int[][] tree, int treeLength)
        {
            TableNumber = tableNumber;
            XLength = x;
            YLength = y;
            LinBitCount = linBitCount;
            LinBitMax = linBitMax;
            Tree = tree ?? throw new ArgumentNullException("Tree");
            TreeLength = treeLength;
        }

        /// <summary>
        /// Do the huffman-decoding.
        /// </summary>
        /// <param name="x">The x.</param>
        /// <param name="y">The y.</param>
        /// <param name="v">The v.</param>
        /// <param name="w">The w.</param>
        /// <param name="br">The BitReserve.</param>
        /// <returns>Returns true on success, false otherwise.</returns>
        public bool Decode(int[] x, int[] y, int[] v, int[] w, MP3BitReserve br)
        {
            // array of all huffcodtable headers
            // 0..31 Huffman code table 0..31
            // 32,33 count1-tables
            int l_Level = 1 << ((4 * 8) - 1);
            int l_Point = 0;
            bool l_Success = false;

            /* table 0 needs no bits */
            if (TreeLength == 0)
            {
                x[0] = y[0] = 0;
                return true;
            }

            /* Lookup in Huffman table. */
            do
            {
                if (Tree[l_Point][0] == 0)
                {
                    /*end of tree*/
                    x[0] = Tree[l_Point][1] >> 4;
                    y[0] = Tree[l_Point][1] & 0xf;
                    l_Success = true;
                    break;
                }

                // hget1bit() is called thousands of times, and so needs to be ultra fast.
                if (br.ReadBit())
                {
                    while (Tree[l_Point][1] >= MXOFF)
                    {
                        l_Point += Tree[l_Point][1];
                    }

                    l_Point += Tree[l_Point][1];
                }
                else
                {
                    while (Tree[l_Point][0] >= MXOFF)
                    {
                        l_Point += Tree[l_Point][0];
                    }

                    l_Point += Tree[l_Point][0];
                }
                l_Level = l_Level >> 1;
            }
            while ((l_Level != 0) || (l_Point < 0));

            /* Process sign encodings for quadruples tables. */
            if (TableNumber == 32 || TableNumber == 33)
            {
                v[0] = (y[0] >> 3) & 1;
                w[0] = (y[0] >> 2) & 1;
                x[0] = (y[0] >> 1) & 1;
                y[0] = y[0] & 1;

                /* v, w, x and y are reversed in the bitstream. switch them around to make test bistream work. */

                if (v[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        v[0] = -v[0];
                    }
                }

                if (w[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        w[0] = -w[0];
                    }
                }

                if (x[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        x[0] = -x[0];
                    }
                }

                if (y[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        y[0] = -y[0];
                    }
                }
            }
            else
            {
                // Process sign and escape encodings for dual tables.
                // x and y are reversed in the test bitstream.
                // Reverse x and y here to make test bitstream work.
                if (LinBitCount != 0)
                {
                    if ((XLength - 1) == x[0])
                    {
                        x[0] += br.ReadBits(LinBitCount);
                    }
                }

                if (x[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        x[0] = -x[0];
                    }
                }

                if (LinBitCount != 0)
                {
                    if ((YLength - 1) == y[0])
                    {
                        y[0] += br.ReadBits(LinBitCount);
                    }
                }

                if (y[0] != 0)
                {
                    if (br.ReadBit())
                    {
                        y[0] = -y[0];
                    }
                }
            }
            return l_Success;
        }
